        /// <summary>
        /// Sweet heart takes this away!
        /// Basically generating 1 frame
        /// </summary>
        public static string GenerateChart(Time time, double widthPx, double heightPx)
        {
            //PART I : declare the components
            string svgHead = null;
            string svgTail = null;
            string border = null;
            string contentTail = null;
            string content = null;
            string Planets = null;
            string signRuler = null;
            string houseRuler = null;
            string zodiacRuler = null;
            string dateTimeLocation = null;
            string locationHeader = null;



            //PART II : fill the components in order
            GenerateComponents();



            //PART III : compile in right placement
            var final =
                $@" <!--MADE BY MACHINES FOR HUMAN EYES-->
                    {svgHead}
                        {SouthChartBack}
                        {Planets}
                    {svgTail}
                ";


            return final;




            //------------------------LOCALS NEEDED FOR REFS

            async void GenerateComponents()
            {
                //STEP 0: RESET
                foreach (var zodiac in ZodiacSign.All12ZodiacNames) { SouthChartOccupiedMarker[zodiac] = 0; }

                //STEP 1: USER INPUT > USABLE DATA
                var svgBackgroundColor = "#f0f2f5"; //not bleach white
                var randomId = Tools.GenerateId();

                Planets = GetPlanetsPositionLayer(time);


                //note: if width & height not hard set, parent div clips it
                var svgTotalHeight = heightPx;//todo for now hard set, future use: verticalYAxis;
                var svgTotalWidth = widthPx;//todo for now hard set, future use: verticalYAxis;
                var svgStyle = $@"background:{svgBackgroundColor};";//end of style tag
                svgHead = $"<svg viewBox=\"0 0 {svgTotalWidth} {svgTotalHeight}\" width=\"{svgTotalWidth}px\" height=\"{svgTotalHeight}px\" style=\"{svgStyle}\" class=\"SkyChartHolder\" id=\"{randomId}\" xmlns=\"http://www.w3.org/2000/svg\" xmlns:xlink=\"http://www.w3.org/1999/xlink\">";//much needed for use tags to work

                svgTail = "</svg>";
                contentTail = "</g>";


            }

        }

        private static string GetPlanetsPositionLayer(Time time)
        {
            var compiled = "";
            var allPlanetsSigns = Calculate.AllPlanetSigns(time);

            foreach (var planetSign in allPlanetsSigns)
            {
                var zodiacSign = planetSign.Value;
                var coordinates = GetPositionForHouseSouth(zodiacSign.GetSignName());
                var xx = $"<text  transform=\"matrix(1 0 0 1 {coordinates.xAxis} {coordinates.yAxis})\" font-size=\"35\" fill=\"black\">{planetSign.Key}</text>";
                compiled += xx;
            }

            var finalGroup = $@"<g id=""PlanetLayer"">{compiled}</g>";

            return finalGroup;
        }

        private static dynamic GetPositionForHouseSouth(ZodiacName zodiacName)
        {

            var xAxis = 0;
            var yAxis = 0;


            //check if occupancy number
            var occupancy = SouthChartOccupiedMarker[zodiacName];
            var jumpCount = occupancy * 45;

            //increment for next check
            SouthChartOccupiedMarker[zodiacName]++;

            xAxis = SouthChartSignCoordinates[zodiacName].xAxis;
            yAxis = SouthChartSignCoordinates[zodiacName].yAxis + jumpCount; //if any will go next row


            return new { xAxis = xAxis, yAxis = yAxis };
        }


    }

}
